import React, { useState, useEffect } from 'react';
import PatientNavBar from '../../components/PatientNavBar';
import PatientFooter from '../../components/PatientFooter';
import { Calendar, dateFnsLocalizer } from 'react-big-calendar';
import format from 'date-fns/format';
import parse from 'date-fns/parse';
import startOfWeek from 'date-fns/startOfWeek';
import getDay from 'date-fns/getDay';
import "react-big-calendar/lib/css/react-big-calendar.css";
import { Link } from 'react-router-dom';

const PatientAppointment = () => {
  const [patientUserId, setPatientUserId] = useState(''); // To store the patient's user ID
  const [isError, setIsError] = useState(false); 
  const [appointments, setAppointments] = useState([
    {
      title: '',
      start: new Date(),
      end: new Date()  // 5:00 PM
    },
  ]);
  useEffect(() => {
    // Replace 'http://localhost:8080' with your actual API URL
    fetch('http://localhost:8080/checkLoggedInPatient')
        .then((response) => {
            if (response.ok) {
                return response.json();
            }
            throw new Error('Network response was not ok');
        })
        .then((data) => {
            setPatientUserId(data);
            // Once you have the patientUserId, make another request to get appointments
            fetch(`http://localhost:8080/appointment/${data}`)
                .then((appointmentsResponse) => {
                    if (appointmentsResponse.ok) {
                        return appointmentsResponse.json();
                    }
                    throw new Error('Network response was not ok');
                })
                .then((appointmentsData) => {
                  console.log(appointmentsData.scheduleDate);
                  console.log(appointmentsData.startTime);

                  console.log(appointmentsData.endTime);

                  const [year, month, day] = appointmentsData.scheduleDate.split('-').map(Number);
                  const [hours, minutes, seconds] = appointmentsData.startTime.split(':').map(Number);
                  const [hours2, minutes2, seconds2] = appointmentsData.endTime.split(':').map(Number);

                  // // Create a new Date object by combining the date and time
                  const startDate = new Date(year, month - 1, day, hours, minutes); // Note: Month is 0-based, so subtract 1
                  const endDate = new Date(year, month - 1, day, hours, minutes2);
                  setAppointments([
                    {

                      title: appointmentsData.doctorName, // Set the title from appointmentsData
                      start: new Date(year, month - 1, day, 6, 0), // Set the start date from appointmentsData
                      end: new Date(year, month - 1, day, 6, 0) /* Set the end date */,
                    },
                    // You can add more appointment objects here as needed
                  ]);
                })
                .catch((appointmentsError) => {
                    setIsError(true);
                    console.error('Error:', appointmentsError);
                });
        })
        .catch((error) => {
            setIsError(true);
            console.error('Error:', error);
        });
}, []);

  const locales = {
    "en-US": require("date-fns/locale/en-US")
  }

  const localizer = dateFnsLocalizer({
    format,
    parse,
    startOfWeek,
    getDay,
    locales
  })

  // Define your appointment data


  return (
    <div>
      <PatientNavBar />
      <div style={{ display: "flex", margin: "auto", width: "100vw", justifyContent: "center" }}>
        <Calendar
          localizer={localizer}
          events={appointments}
          startAccessor="start"
          endAccessor="end"
          style={{ height: 600, width: "65%" }}
        />

        <div style={{ marginLeft: "30px" }}>
          <h1>My Appointments</h1>
          <table>
            {appointments.map((appointment, index) => (
              <tr key={index}>
                <td rowSpan={2} width={200} style={{ border: "1px solid lightgray", backgroundColor: "lightgray", paddingLeft: "10px" }}>
                  {appointment.title} <br />
                  {format(appointment.start, "MM/dd/yyyy EEEE")} <br />
                  {format(appointment.start, "h:mm a")} - {format(appointment.end, "h:mm a")}
                </td>
                <td><Link to="/patresched"><button style={{ borderRadius: 0, width: "100%" }}>Reschedule</button></Link></td>
              </tr>
            ))}
            <tr>
              <td><button style={{borderRadius: 0, width:"100%", backgroundColor: "grey"}}>Cancel</button></td>
            </tr>
          </table>
        </div>

      </div>
      <PatientFooter />
    </div>
  );
}

export default PatientAppointment;
